import React, { useState } from "react";
import axios, { Axios } from "axios";

const SetSelect  = () => {

    const [sets, setSetsName] = useState()

    axios.get("https://api.scryfall.com/sets")
    .then(res => {
        const sets = res.data;
    })


    return(
        <ul>
            {
            sets
            }
        </ul>
    )
}

export default SetSelect
